import React from 'react'

export default class InstructorCourse extends React.Component {
  constructor(props) {
    super(props)

    this.state = {
      course: props.course
    }
  }

  render() {
    return(
      <React.Fragment>
        <h5></h5>
      </React.Fragment>
    )
  }
}
